import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-projects',
  templateUrl: './projects.component.html',
  styleUrls: ['./projects.component.scss'],
})
export class ProjectsComponent {
  projects = [
    {
      id: 1,
      title: 'Al Shaya Tower',
      thumbnail: 'assets/projects/al-shaya-thumbnail.jpg',
      images: [
        'assets/projects/al-shaya1.jpg',
        'assets/projects/al-shaya2.jpg',
        // Add 13 more image paths
      ],
      location: 'Dubai, UAE',
      description: 'A state-of-the-art tower located in Dubai.',
      timeline: '2023 - 2024',
    },
    // Add details for other projects
  ];

  constructor(private router: Router) {}

  viewProject(project: any) {
    this.router.navigate(['/projects', project.id]);
  }
}
